column8:
100時間以上かけて仕上げる牛肉に合うこだわりのカレーソース。<br>直火で丁寧に焼き上げたルーを2種類(鶏、牛)のフォンでのばし、甘味が十分に出るまでソテーした野菜、フルーツと独自のスパイスで仕上げたソースに香辛料でじっくり3時間やわらかくなるまで煮込んだ牛肉を加えました。<br>化学調味料を使用せず、素材のうまみをいかしました。<br><br>カレールーの焼き上げ、熟成・・・・23時間<br>フォンの煮出し・・・・30時間<br>野菜のソテー、熟成・・・・44時間<br>ソースの煮込み、ねかせ、仕上げ・・・・16時間<br>牛肉の煮込み・・・・3時間<br>100時間以上かけて神戸でつくったこだわりのカレーです。<br><br>★電子レンジで温める場合<br>耐熱容器等に移し替え、ラップをかけて、約2分程度(500W)温めてください。<br><br>★湯煎で温める場合<br>袋のまま沸騰したお湯で約5分湯煎してください。<br><br>【栄養成分】(1袋200g当たり)<br>エネルギー：295kcal<br>たんぱく質：9.0g<br>脂質：18.2g<br>炭水化物：23.8g<br>ナトリウム：970mg<br>食塩相当量：2.5g<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：MCC<br>内容量：200g<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901012047457 14901012047454 SH5384 sh5384 MCC 100時間かけたカレー 200g エムシーシー レトルト れとると カレー かれー 100時間</font></td></tr></table><style type="text/css">
